Lists.transform(assertObj.getOrderByColumns(),new Function<com.dangdang.ddframe.rdb.sharding.parsing.jaxb.OrderByColumn,OrderBy>(){
  @Override public OrderBy apply(  final com.dangdang.ddframe.rdb.sharding.parsing.jaxb.OrderByColumn input){
    return Strings.isNullOrEmpty(input.getName()) ? new OrderBy(input.getIndex(),OrderType.valueOf(input.getOrderByType().toUpperCase())) : new OrderBy(input.getOwner(),input.getName(),OrderType.valueOf(input.getOrderByType().toUpperCase()),Optional.fromNullable(input.getAlias()));
