Lists.transform(assertObj.getAggregationSelectItems(),new Function<com.dangdang.ddframe.rdb.sharding.parsing.jaxb.AggregationSelectItem,AggregationSelectItem>(){
  @Override public AggregationSelectItem apply(  final com.dangdang.ddframe.rdb.sharding.parsing.jaxb.AggregationSelectItem input){
    AggregationSelectItem result=new AggregationSelectItem(input.getExpression(),Optional.fromNullable(input.getAlias()),-1,AggregationType.valueOf(input.getAggregationType().toUpperCase()));
    if (null != input.getIndex()) {
      result.setColumnIndex(input.getIndex());
    }
    for (    com.dangdang.ddframe.rdb.sharding.parsing.jaxb.AggregationSelectItem each : input.getDerivedColumns()) {
      result.getDerivedAggregationSelectItems().add(new AggregationSelectItem(each.getExpression(),Optional.fromNullable(each.getAlias()),-1,AggregationType.valueOf(each.getAggregationType().toUpperCase())));
    }
    return result;
  }
}
